private void setInputFromSavedData() {
  int len = Math.min(userBufLen, uncompressedDirectBuf.remaining());
  uncompressedDirectBuf.put(userBuf, userBufOff, len);
  userBufLen -= len;
  userBufOff += len;
  uncompressedDirectBufLen = uncompressedDirectBuf.position();
}
